import React from 'react';

function Section() {
  return (
    <div className="container bg-success">
       <div className='row'>
        <div className="col-md-4">
                1
        </div>
        <div className="col-md-4">
            2
        </div>
        <div className="col-md-4">
            3
        </div>
       </div>
    </div>
  );
}

export default Section;
